import React from 'react';

const WindowScoreBoard = (data) => {
    const instance = data.props;
    console.log(instance);
    return (
        <div className="window-score-board">
            {/* Home Score */}
            <div className="home-score">
                <h5>{instance.leader.name}</h5>
                <h4 className="sb-score">{instance.leader.img}</h4>
            </div>

            {/* Score Board */}
            <div className="clock">
                <h5>{instance.second.name}</h5>
                <h4>QTR {instance.second.img}</h4>
            </div>

            {/* Away Score */}
            <div className="away-score">
                <h5>{instance.third.name}</h5>
                <h4 className="sb-score">{instance.third.img}</h4>
            </div>

        </div>
    )
}

export default WindowScoreBoard;
